// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awLovListRenderFunction } from 'js/AwLovListService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwLovListService', () => import('js/AwLovListService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awLovListRenderFunction",
            "deps": "js/AwLovListService"
        },
        "onMount": {
            "actionType": "JSFunction",
            "method": "onMount",
            "inputData": {
                "prop": "{{props}}"
            },
            "outputData": {
                "selectedEntries": null
            },
            "deps": "js/AwLovListService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "i18n": {
        "NO_LOV_VALUES": [
            "BaseMessages"
        ]
    },
    "lifecycleHooks": {
        "render": "render",
        "onMount": "onMount"
    },
    "_viewModelId": "AwLovList",
    "_uniqueViewModelId": "AwLovList",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awLovListRenderFunction, undefined, ctxImportObj );

export default Component;
